var BlocklyGamesMsg={"Games.name":"Gry Blockly","Games.music":"Muzyka","Games.linesOfCode1":"Rozwiązałeś ten poziom za pomocą 1 linii JavaSkryptu:","Games.linesOfCode2":"Rozwiązałeś ten poziom za pomocą %1 linii JavaSkryptu:","Games.nextLevel":"Jesteś gotów na %1 poziom?","Games.finalLevel":"Jesteś gotów na następne wyzwanie?","Games.submitTitle":"Tytuł:","Games.linkTooltip":"Zapisz i podlinkuj do klocków","Games.runTooltip":"Uruchom napisany przez Ciebie program.","Games.runProgram":"Uruchom Program","Games.resetTooltip":"Zatrzymaj program i zresetuj poziom.","Games.resetProgram":"Zresetuj","Games.help":"Pomoc","Games.catLogic":"Logika","Games.catLoops":"Pętle","Games.catMath":"Matematyka","Games.catLists":"Listy","Games.catVariables":"Zmienne","Games.catProcedures":"Funkcje","Games.httpRequestError":"Wystąpił problem z żądaniem.","Games.linkAlert":"Udostępnij swoje klocki korzystając z poniższego linku: \n\n\n%1","Games.hashError":"Przepraszamy, \"%1\" nie odpowiada żadnemu zapisanemu programowi.","Games.submitted":"Dziękujemy za ten program! Jeśli nasi pracownicy wyszkolonych małp to lubią, opublikują go w galerii w ciągu kilku dni.","Games.congratulations":"Gratulacje!","Games.helpAbort":"Ten poziom jest bardzo trudny. Czy chciałbyś/chciałabyś pominąć go i iść do następnej gry? Możesz zawsze powrócić później.","Music.playNoteTooltip":"Odtwórz jeden ton o zadanym czasie trwania i wysokości.","Music.playNote":"graj %1 nota %2","Music.restTooltip":"Czeka przez określony czas.","Music.restWholeTooltip":"Czeka na jedną całą nutę.","Music.rest":"reszta %1","Music.setInstrumentTooltip":"Przełącza się na określony instrument podczas odtwarzania kolejnych nut.","Music.setInstrument":"ustaw instrument na %1","Music.startTooltip":"Wykonuje bloki wewnątrz po kliknięciu przycisku „Uruchom program”.","Music.start":"po kliknięciu %1","Music.pitchTooltip":"Jedna uwaga (C4 to 7).","Music.firstPart":"pierwsza część","Music.piano":"Piano","Music.trumpet":"trąbka","Music.banjo":"banjo","Music.violin":"skrzypce","Music.guitar":"Gitara","Music.flute":"flet","Music.drum":"bęben","Music.choir":"chór","Music.galleryTooltip":"Otwórz galerię muzyki.","Music.galleryMsg":"Zobacz Galerię","Music.submitTooltip":"Wyślij swoją muzykę do galerii","Music.submitMsg":"Wyślij do Galerii","Music.helpUseFunctions":"Twoje rozwiązanie działa, ale możesz zrobić to lepiej. Użyj odpowiedniej funkcji, aby zmniejszyć ilość powtarzanego kodu.","Music.helpUseInstruments":"Muzyka będzie brzmiała lepiej, jeśli użyjesz innego instrumentu w każdym bloku początkowym.","Music.helpText1":"Skomponuj pierwsze cztery nuty „Frère Jacques”.","Music.helpText2a":"„Funkcja” umożliwia grupowanie bloków, a następnie uruchamianie ich więcej niż jeden raz.","Music.helpText2b":"Utwórz funkcję, aby zagrać pierwsze cztery nuty „Frère Jacques”. Uruchom tę funkcję dwukrotnie. Nie dodawaj żadnych nowych bloków notatek.","Music.helpText3":"Utwórz drugą funkcję dla następnej części „Frère Jacques”. Ostatnia nuta jest dłuższa.","Music.helpText4":"Utwórz trzecią funkcję dla następnej części „Frère Jacques”. Pierwsze cztery nuty są krótsze.","Music.helpText5":"Ukończ całą melodię „Frère Jacques”.","Music.helpText6a":"Ten nowy blok umożliwia przejście na inny instrument.","Music.helpText6b":"Zagraj swoją melodię na skrzypcach.","Music.helpText7a":"Ten nowy blok dodaje ciche opóźnienie.","Music.helpText7b":"Utwórz drugi blok początkowy, który ma dwa bloki opóźniające, a następnie zagraj także „Frère Jacques”.","Music.helpText8":"Każdy blok startowy powinien zagrać „Frère Jacques” dwa razy.","Music.helpText9":"Stwórz cztery bloczki startowe, z których każdy zagra dwa razy „Frère Jacques”. Dodaj odpowiednią liczbę bloków opóźniających.","Music.helpText10":"Skomponuj, co chcesz. Masz ogromną liczbę nowych bloków, które możesz eksplorować. Baw się dobrze!","Music.helpText10Reddit":"Użyj przycisku 'Zobacz galerię', aby zobaczyć, co skomponowali inni użytkownicy. Jeśli skomponujesz coś interesującego, użyj przycisku 'Prześlij do galerii', aby go opublikować."}
